//import { memo } from 'react';
import { people } from '../../data/people';

export const SearchReult = (choose = '') => {

  //console.log('Me volvi a llamar :(');
  if( choose === ''){
      return [];
  }  
  choose = choose.toLowerCase(); 
  return people.filter( value  => (
        value.name.toLowerCase().includes(choose) ||
        value.email.toLowerCase().includes(choose)||
        value.username.toLowerCase().includes(choose) ||
        value.phone.toLowerCase().includes(choose)
  ))
};
